import { browser } from "$app/environment"
import { beepVolume } from "$lib/settings"
import { get } from "svelte/store"

const wavUri = `data:audio/wav;base64,`

const sleep = async (ms: number = 1000) => await new Promise(() => setTimeout(() => {}, ms))

export const playBeep = async (times = 1) => {
	if (!browser) return

	const audio = new Audio(wavUri)
	audio.volume = get(beepVolume)

	for (let i = 0; i < times; i++) {
		audio.play()
		await sleep()
		audio.pause()
		audio.currentTime = 0
		await sleep()
	}
}
